function getQueryString(name) {
    var reg = new RegExp("(^|&)" + name + "=([^&]*)(&|$)", "i");
    var r = window.location.search.substr(1).match(reg);
    if (r != null) return decodeURIComponent(r[2]); return null;
}
//YYYYMMDDYYYY-MM-DD  --      dateTime type,
function formatDate(dateTime,type){
    if(!dateTime) return;
    var dateStr;
    if(!type){
        dateTime = dateTime.toString();
        var year = dateTime.substr(0,4);
        var month = dateTime.substr(4,2);
        var day = dateTime.substr(6,2);
        dateStr = year + "-" + month +"-"+ day;
    }else{
        var d = new Date(parseFloat(dateTime));
        var year = d.getFullYear();     
        var month = d.getMonth()+1;     
        var date = d.getDate();
        var hour = d.getHours();
        var minute = d.getMinutes();
        var second = d.getSeconds();
        if(hour < 10){
            hour = "0" + hour;
        }
        if(minute < 10){
            minute = "0" + minute;
        }
        var day = d.getDay();
        
        var dayStr;
        switch(day){
            case 0:
            dayStr = "";
            break;
            case 1:
            dayStr = "";
            break;
            case 2:
            dayStr = "";
            break;
            case 3:
            dayStr = "";
            break;
            case 4:
            dayStr = "";
            break;
            case 5:
            dayStr = "";
            break;
            case 6:
            dayStr = "";
            break;
            default:
            break;
        }
        dateStr = year + "-" + month + "-" + date + "  " + dayStr + " " + hour + ":" + minute;
    }
    return dateStr;
}
// 093000 -> 09:30
function formatTime(time) {
    time = time.toString();
    //TODO 0
    if (time.length !== 6) {
        var diff = 6 - (time.length);
        var zero = "";
        for (var i = 0; i < diff; i++) {
            zero += "0";
        }
        time = zero + time;
    }
    var H = time.substring(0, 2);
    var m = time.substring(2, 4);
    time = H + ":" + m;
    return time;
}

// "2017-01-01 02:03"  1483207380()
function dateToStamp(date){
    if(date.indexOf("-")>-1){
        date = date.replace(/-/g,'/');
    }
    return Date.parse(new Date(date));
}
